import React from "react";
import json from "../amp.json";
import "../index.css";


import { ComposableMap, Geographies, Geography } from "react-simple-maps";


function Map(props) {

  return (

    <div className="map-container">
        <ComposableMap style = {{marginTop:""}} width= {1000} height = {1000} projectionConfig={{scale: 500}}>
        <Geographies geography={json}>
        {({ geographies }) =>
          geographies.map(geo => <Geography key={geo.rsmKey} geography={geo} />)
        }
      </Geographies>
    </ComposableMap>
    </div>

  );
}

export default Map;
